import React, { Component } from "react";

class Selector extends React.Component {
  render() {
    const { id, lab, opt1, opt2 } = this.props.selector;
    // console.log(this.props.selector.lab);
    return (
      <div className="m-2">
        <span className="me-2">{this.props.selector.lab} </span>
        <div className="btn-group">
          <input
            type="radio"
            name={this.props.selector.lab}
            className="btn-check"
            id="btn-check1"
            autoComplete="off"
          />
          <label className="btn btn-outline-primary" hrmlFor="btn-check1">
            {this.props.selector.opt1}
          </label>
          <input
            type="radi"
            name={this.props.selector.lab}
            className="btn-check"
            id="btn-check2"
            autoComplete="off"
          />
          <label className="btn btn-outline-primary" htmlFor="btn-check2">
            {this.props.selector.opt2}
          </label>
        </div>
      </div>
    );
  }
}

export default Selector;
